import React from 'react';
import './style.css';
import { Container, Row, Col, Button, Card } from 'react-bootstrap';

class Item extends React.Component{
	render(){
		const { itemName, itemQuantity, itemPrice, removeItem } = this.props;

		return(
			<Card border="info">
				<Row className="itemRow">
					<Col>{itemName}
					</Col>
					<Col>Quantity: {itemQuantity}
					</Col>
					<Col>${itemPrice}
					</Col>
					<Col>
						<Button variant="outline-danger" 
								size="sm"
								onClick={removeItem}>
							Delete
						</Button>
					</Col>
				</Row>
			</Card>
		)
	}
}

export default Item;
